 Iâ€™m doing it old school, 6 days a week, 1.5 hrs a day. Itâ€™s totally changing by body, building strength through my core, and opening the calves, legs, hip and back, the root cause, I suspect, of this dreaded condition. Iâ€™m hoping to make my return to the roads in about 4 weeks.

